import { Link } from "react-router-dom";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import '../App.css';
const PrendasList = ({ prendas }) => {
    return (
        <div  id='containerGrid'>
         <TableContainer component={Paper} style={{ width: '50%', margin: 'auto' }}>
                        <Table sx={{ minWidth: 650 }} aria-label="simple table">
                            <TableHead>
                            <TableRow>
                                <TableCell align="right">ID</TableCell>
                                <TableCell align="right">Descripcion</TableCell>
                                <TableCell align="right">Tipo</TableCell>
                                <TableCell align="right">Precio Base</TableCell>
                            </TableRow>
                            </TableHead>
            {prendas.map(prendas => {
                return (
                    <>
                            <TableBody>
                                <TableRow>
                                <TableCell align="right" style={{backgroundColor: red}}>{prendas.id}</TableCell>
                                <TableCell align="right">{prendas.descripcion}</TableCell>
                                <TableCell align="right">{prendas.tipo}</TableCell>
                                <TableCell align="right">{prendas.precioBase}</TableCell>
                                <TableCell> <Link to={`/prendas/${prendas.id}`}>Editar</Link> </TableCell>
                                </TableRow>
                            </TableBody>
                    </>
                    
                )
            })}
                        </Table>
        </TableContainer>
        </div>
    );
}

export default PrendasList;
